 import React from "react";
import Card from "./Card";
import contacts from "../contacts";
import Avatar from "./Avatar";
import Gabriel from "../../images/fotor-ai-20231021141543.jpg"


function App() {
  return (
    <div>
      <h1 className="heading">My Contacts</h1>
      <Avatar 
      img="https://www.google.com/url?sa=i&url=https%3A%2F%2Ftwitter.com%2Fyu_angela&psig=AOvVaw23GoBqLj1acxJhNckkTLRK&ust=1698003306901000&source=images&cd=vfe&opi=89978449&ved=0CBEQjRxqFwoTCKDEzbHxh4IDFQAAAAAdAAAAABAE"
      />

      <Card
        name={contacts[0].name}
        img={contacts[0].imgURL}
        tel={contacts[0].phone}
        email={contacts[0].email}
      />
      <Card
        name={contacts[1].name}
        img={contacts[1].imgURL}
        tel={contacts[1].phone}
        email={contacts[1].email}
      />
      <Card
        name={contacts[2].name}
        img={contacts[2].imgURL}
        tel={contacts[2].phone}
        email={contacts[2].email}
      />
    </div>
  );
}

export default App;
